import React from 'react';

const CardW = (props) => {
    return (
        <div className='flex gap-[2.5rem]'>
            
            {/* image */}
            <div className='bg-[#EAE7E7] opacity-65 rounded-[0.6rem] items-center w-[20rem] flex justify-center  '>
                <img className='w-[15rem] h-[15rem]' src="./sample.png" alt="" srcset="" />
            </div>

            {/* Written part */}
            <div className='p-8 w-[45rem] bg-[#EAE7E7] bg-opacity-65 rounded-lg'>
                    <p className='font-montserrat  font-extrabold text-2xl tracking-tight '>{props.workplace}</p>
                    <p className='font-montserrat opacity-65 text-[0.8rem] tracking-tight '>{props.workrole}</p>
                    <ul>
                        <li className='font-montserrat opacity-65 text-[0.8rem] pt-[0.8rem] tracking-tight'>{props.li1}</li>
                        <li className='font-montserrat opacity-65 text-[0.8rem] pt-[0.8rem] tracking-tight'>{props.li2}</li>
                        <li className='font-montserrat opacity-65 text-[0.8rem] pt-[0.8rem] tracking-tight'>{props.li3}</li>
                        <li className='font-montserrat opacity-65 text-[0.8rem] pt-[0.8rem] tracking-tight'>{props.li4}</li>
                    </ul> 
            </div>

        </div>
    );
}

export default CardW;
